import React, { Component } from "react";
import Item from "./Item";

class Items extends Component {
  constructor() {
    super();
    state = {
      items: [
        {
          name: "Iphone XS",
          id: 1,
          src: "https://cdn1.ozone.ru/multimedia/c1200/1024351493.jpg",
          price: 10
        },
        {
          name: "Samsung S10",
          id: 2,
          src: "https://img.mvideo.ru/Pdb/30042519b.jpg",
          price: 10
        },
        {
          name: "Macbook pro 2019",
          id: 3,
          src:
            "https://aip-a.akamaihd.net/2019/02/MacBook-Pro-2019-budet-polnostyu-pererabotan-2.jpg",
          price: 10
        }
      ]
    };
  }

  render() {
    return this.state.items.map(item => (
      <Item key={this.state.items.id} item={item} />
    ));
  }
}

export default Items;
